import React  from "react";
import {Link} from 'react-router-dom'


const Nav = () => {

    return (
        
        <div className="nav-bar-main-div">
         <ul>
           <button  className="apply-visa">
           <Link to='/apply'> Apply For Visa </Link>
           </button>
            <li className="nav-bar"> Home </li>
            <li className="nav-bar"> Contact Us </li>
         </ul>
        </div>
    )
}
export default Nav
